import { makeStyles } from '@mui/styles';

export default makeStyles({
  productSection: {
    padding: '30px',
  },
  details: {
    background: 'rgba(99,99,99, 0.15)',
    padding: '20px'
  },
  imageHolder: {
    maxWidth: '100%'
  },
  image: {
    width: '380px',
    height: '380px',
  }
});
